package Sample1;

public class No_Patterns {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int row=5;
		int col=5;
		
		int k=1;
		for(int i=1;i<=row;i++) {
			
			for(int j=1;j<=col;j++) {
				
				System.out.print(k);
			k++;
			}
			System.out.println();
		}
	}

}
